　大人気！ポケットモンスターXYの<br>
メガシンカシリーズのランチグッズが登場☆<br>
とてもかっこいい水筒はプッシュ式で簡単オープン！<br>
食洗機対応・ショルダーベルト付きも嬉しいですね！<br>
ランチの時間が楽しくなっちゃうかも！？<br>
<br>
【サイズ】<br>
約95×φ79×210mm<br>
【容量】<br>
480ml<br>
【材質】<br>
キャップ：飽和ポリエステル<br>
本体・フタ・ベルト止め：ポリプロピレン<br>
パッキン：シリコン樹脂<br>
バネ・ピン：ステンレス<br>
<br>
