　ポケモンXYの仲間たちがいっぱい！楽しいステンレス水筒の登場です☆<br>
飲みたい時にすぐ飲める、便利なダイレクトタイプ！<br>
キャップにロックが掛けられるから、誤作動によるキャップの開閉の心配がなく安心です◎<br>
<br>
【仕様】<br>
容量：800ml<br>
保冷効力：8度以下（6時間）<br>
・ショルダーベルト付き<br>
・氷が入れやすいワイド口径<br>
・キャップの誤開閉を防ぐロック機能<br>
・飲むときにキャップが戻らない「キャップロック設計」<br>
<br>
【材質】<br>
内ビン、口金：ステンレス鋼<br>
胴部：ステンレス鋼（アクリル樹脂塗装）<br>
キャップ：メタクリル樹脂/ABS樹脂<br>
フタ：ポリプロピレン<br>
パッキン：シリコーン<br>
底板：エラストマー<br>
<br>
