　ポケットモンスターサン&ムーンのかっこいいステンレス水筒☆<br>
キャップを開けてすぐ飲めるダイレクトタイプ♪<br>
お子様でも持ちやすい軽量タイプです！<br>
氷が入れやすいワイド口径が嬉しいですね！<br>
底板付きで置くときの音が気になりません☆<br>
<br>
【仕様】<br>
・ネームプレート、ショルダーベルト付<br>
・保冷専用<br>
・誤作動防止ロック機能付<br>
<br>
【サイズ】<br>
約Φ68×H230ｍｍ<br>
<br>
【容量】<br>
470ｍｌ<br>
<br>
