食器洗い乾燥機ＯＫのお箸とケースのセットです。<br>
<br>
ケースは、指で引き出すスライド式で、<br>
衝撃に強くこわれにくい丈夫な構造です。<br>
<br>
フタの本体からの抜け落ちを防ぐ、<br>
外れにくい構造のストッパー付き。<br>
<br>
力を入れて引っ張ると外れるので、<br>
洗いやすく分解可能になっています。<br>
<br>
おハシには名前を入れられるスペース付き。<br>
<br>
ケース用の名前シールも付いてます。<br>
<br>
○商品サイズ<br>
・ケースサイズ：195×27×15mm<br>
・ハシの長さ：16.5cm<br>
<br>
≪品質表示≫<br>
・フタ：ＡＳ樹脂／耐熱温度：100度<br>
・本体：ポリプロピレン／耐熱温度：140度<br>
・ハシ：ＡＳ樹脂／耐熱温度：100度<br>
<br>【Made in Japan】<BR>

